import React, { Component } from 'react';

class Button extends Component {

    handleClick = () => {
        console.log('this is:', this);
        this.setState({graphType: this.children});
      }

      render() {
        return (
            <button onClick={() => this.handleClick()}>
                {this.props.children}
            </button>
        );
      }
    }

export default Button;
